  <style>
      body {
          background-color: black;
          color: white;
      }
      label {
          white-space: pre;
          width: 100px;
          height: 100px;
          background-repeat: no-repeat;
          background-position-x: center;
          text-align: center;
          float: left;
          margin: 5px;
          border-color: transparent;
          border-style: solid;
          border-width: 2px;
          border-radius: 8px;
      }
      label:hover {
          background-position-y: 20px;
          background-size: 80px;
      }
      label:hover:after {
          content: attr(for);
      }
      input[type=checkbox] {
          display: none;
      }
      input[type=checkbox]:checked + label {
          border-color: crimson;
          background-position-y: 20px;
          background-size: 80px;
      }
      input[type=checkbox]:checked + label:after {
          content: attr(for);
      }
  </style>
</head>
